import React, { useState, useEffect } from 'react';
import {
  Box,
  Container,
  Grid,
  Typography,
  Card,
  CardContent,
  Avatar,
  Button,
  Paper,
  IconButton,
  Chip,
  Snackbar,
  Alert,
  Tabs,
  Tab,
  List,
  ListItem,
  ListItemText,
  ListItemSecondaryAction,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  CircularProgress,
  Divider,
  Badge,
  Stack,
  Switch,
  FormControlLabel,
  FormControl,
  FormLabel,
  RadioGroup,
  Radio,
  Tooltip,
  LinearProgress
} from '@mui/material';
import {
  Edit,
  Save,
  Cancel,
  PhotoCamera,
  MusicNote,
  QueueMusic,
  Favorite,
  PlayArrow,
  Share,
  CloudUpload,
  BarChart,
  TrendingUp,
  People,
  Star,
  Visibility,
  Settings,
  Security,
  Notifications,
  Delete,
  Psychology,
  AutoAwesome,
  Lightbulb,
  Analytics
} from '@mui/icons-material';
import { useAuth } from '../contexts/AuthContext';
import { useNavigate } from 'react-router-dom';
import AvatarUploadDialog from '../components/AvatarUploadDialog';
import AIRecommendations from '../components/AIRecommendations';
import axios from 'axios';
import useSyncTrackCounts from '../hooks/useSyncTrackCounts';
import { formatPlays, formatNumberCompact } from '../utils/format';
import { usePlayer } from '../contexts/PlayerContext';
// import Tooltip from '@mui/material/Tooltip';

// Configure axios
axios.defaults.baseURL = 'http://localhost:5002';
axios.defaults.withCredentials = true;
axios.interceptors.request.use((config) => {
  const token = localStorage.getItem('token');
  if (token) {
    config.headers.Authorization = `Bearer ${token}`;
  }
  return config;
});

// Clean, simple input component that never loses focus
const CleanInput = ({ label, value, onChange, disabled = false, multiline = false, placeholder = "", type = "text" }) => {
  return (
    <div style={{ marginBottom: '20px' }}>
      <label style={{
        display: 'block',
        marginBottom: '8px',
        color: disabled ? '#888' : '#667eea',
        fontSize: '14px',
        fontWeight: '500'
      }}>
        {label}
      </label>
      {multiline ? (
        <textarea
          value={value || ''}
          onChange={onChange}
          disabled={disabled}
          placeholder={placeholder}
          rows={4}
          style={{
            width: '100%',
            padding: '12px',
            border: '2px solid rgba(102, 126, 234, 0.3)',
            borderRadius: '8px',
            backgroundColor: disabled ? '#2a2a2a' : '#1a1a1a',
            color: disabled ? '#888' : '#ffffff',
            fontSize: '16px',
            fontFamily: 'inherit',
            outline: 'none',
            resize: 'vertical',
            boxSizing: 'border-box'
          }}
          onFocus={(e) => e.target.style.borderColor = '#667eea'}
          onBlur={(e) => e.target.style.borderColor = 'rgba(102, 126, 234, 0.3)'}
        />
      ) : (
        <input
          type={type}
          value={value || ''}
          onChange={onChange}
          disabled={disabled}
          placeholder={placeholder}
          style={{
            width: '100%',
            padding: '12px',
            border: '2px solid rgba(102, 126, 234, 0.3)',
            borderRadius: '8px',
            backgroundColor: disabled ? '#2a2a2a' : '#1a1a1a',
            color: disabled ? '#888' : '#ffffff',
            fontSize: '16px',
            fontFamily: 'inherit',
            outline: 'none',
            boxSizing: 'border-box'
          }}
          onFocus={(e) => e.target.style.borderColor = '#667eea'}
          onBlur={(e) => e.target.style.borderColor = 'rgba(102, 126, 234, 0.3)'}
        />
      )}
    </div>
  );
};

const Profile = () => {
  const { user, updateUser } = useAuth();
  const navigate = useNavigate();
  const { playTrack, recentlyPlayed } = usePlayer ? usePlayer() : { playTrack: () => {}, recentlyPlayed: [] };

  // State management
  const [activeTab, setActiveTab] = useState(0);
  const [loading, setLoading] = useState(true);
  const [saving, setSaving] = useState(false);
  const [error, setError] = useState(null);
  const [success, setSuccess] = useState(null);
  const [editMode, setEditMode] = useState(false);

  // Profile data
  const [profile, setProfile] = useState({
    username: '',
    email: '',
    display_name: '',
    bio: '',
    avatar_url: '',
    location: '',
    website: '',
    social_links: {
      twitter: '',
      instagram: '',
      soundcloud: '',
      spotify: ''
    }
  });

  // Stats
  const [stats, setStats] = useState({
    tracksUploaded: 0,
    totalPlays: 0,
    totalLikes: 0,
    followers: 0,
    following: 0,
    playlistsCreated: 0
  });

  // User content
  const [userTracks, setUserTracks] = useState([]);
  const [syncedUserTracks, setSyncedUserTracks] = useSyncTrackCounts([]);
  const [userPlaylists, setUserPlaylists] = useState([]);

  // AI Enhancement state
  const [aiSuggestions, setAiSuggestions] = useState(null);
  const [loadingAI, setLoadingAI] = useState(false);
  const [aiAnalysisDialog, setAiAnalysisDialog] = useState(false);

  // Dialog states
  const [avatarUploadDialog, setAvatarUploadDialog] = useState(false);
  const [passwordDialog, setPasswordDialog] = useState(false);
  const [notificationsDialog, setNotificationsDialog] = useState(false);
  const [privacyDialog, setPrivacyDialog] = useState(false);

  // Password form
  const [passwordForm, setPasswordForm] = useState({
    currentPassword: '',
    newPassword: '',
    confirmPassword: ''
  });

  // Settings
  const [notificationSettings, setNotificationSettings] = useState({
    emailNotifications: true,
    pushNotifications: false,
    trackLikes: true,
    newFollowers: true,
    roomInvites: true,
    trackComments: false
  });

  const [privacySettings, setPrivacySettings] = useState({
    profileVisibility: 'public',
    showEmail: false,
    showLocation: true,
    allowDirectMessages: true,
    showOnlineStatus: false,
    showListeningActivity: true
  });

  // Load profile data on mount
  useEffect(() => {
    fetchProfileData();
  }, []);

  // Fetch AI enhancement suggestions when profile loads
  useEffect(() => {
    if (user && profile.username) {
      fetchAIEnhancements();
    }
  }, [user, profile.username]);

  const fetchProfileData = async () => {
    try {
      setLoading(true);

      // Fetch profile
      const profileResponse = await axios.get('/api/users/profile');
      const userData = profileResponse.data.user;

      // Fetch tracks
      const tracksResponse = await axios.get('/api/tracks?limit=50');
      const userTracksData = tracksResponse.data.tracks?.filter(track => track.user_id === userData.id) || [];

      // Fetch playlists
      const playlistsResponse = await axios.get('/api/playlists');
      const userPlaylistsData = playlistsResponse.data.playlists || [];

      // Update profile state
      setProfile({
        username: userData.username || '',
        email: userData.email || '',
        display_name: userData.display_name || userData.username || '',
        bio: userData.bio || '',
        avatar_url: userData.avatar_url || '',
        location: userData.location || '',
        website: userData.website || '',
        social_links: {
          twitter: userData.twitter || '',
          instagram: userData.instagram || '',
          soundcloud: userData.soundcloud || '',
          spotify: userData.spotify || ''
        }
      });

      // Update stats
      const totalPlays = userTracksData.reduce((total, track) => total + (track.play_count || 0), 0);
      setStats({
        tracksUploaded: userTracksData.length,
        totalPlays: totalPlays,
        totalLikes: 0,
        followers: 0,
        following: 0,
        playlistsCreated: userPlaylistsData.length
      });

  setUserTracks(userTracksData);
  setSyncedUserTracks(userTracksData);
      setUserPlaylists(userPlaylistsData);

    } catch (error) {
      console.error('Error fetching profile data:', error);
      setError('Failed to load profile data. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  // Fetch AI enhancement suggestions
  const fetchAIEnhancements = async () => {
    try {
      setLoadingAI(true);
      const response = await axios.get('/api/ai/profile/enhance');
      setAiSuggestions(response.data.suggestions);
    } catch (error) {
      console.error('Error fetching AI suggestions:', error);
      // Non-critical error, don't show to user
    } finally {
      setLoadingAI(false);
    }
  };

  // Apply AI bio suggestion
  const applyAIBioSuggestion = (suggestion) => {
    setProfile(prev => ({ ...prev, bio: suggestion }));
    setEditMode(true);
    setSuccess('AI suggestion applied! Don\'t forget to save your changes.');
  };

  // Analyze track with AI
  const analyzeTrackWithAI = async (track) => {
    try {
      setLoadingAI(true);
      const response = await axios.post('/api/ai/track/analyze', {
        trackId: track.id
      });

      if (response.data.success) {
        setSuccess(`AI Analysis complete for "${track.title}"! Check your track for new insights.`);
        // Refresh tracks to get updated AI data
        fetchProfileData();
      }
    } catch (error) {
      setError('Failed to analyze track with AI');
    } finally {
      setLoadingAI(false);
    }
  };

  // Simple handlers without complex logic
  const handleFieldChange = (field, event) => {
    const value = event.target.value;
    setProfile(prev => ({ ...prev, [field]: value }));
  };

  const handleSocialLinkChange = (platform, event) => {
    const value = event.target.value;
    setProfile(prev => ({
      ...prev,
      social_links: {
        ...prev.social_links,
        [platform]: value
      }
    }));
  };

  const handlePasswordFieldChange = (field, event) => {
    const value = event.target.value;
    setPasswordForm(prev => ({ ...prev, [field]: value }));
  };

  const handleProfileUpdate = async () => {
    try {
      setSaving(true);
      setError(null);

      const updateData = {
        display_name: profile.display_name,
        bio: profile.bio,
        avatar_url: profile.avatar_url,
        location: profile.location,
        website: profile.website,
        twitter: profile.social_links.twitter,
        instagram: profile.social_links.instagram,
        soundcloud: profile.social_links.soundcloud,
        spotify: profile.social_links.spotify
      };

      const response = await axios.put('/api/users/profile', updateData);

      if (response.data.user) {
        updateUser(response.data.user);
        setSuccess('Profile updated successfully!');
        setEditMode(false);
      }

    } catch (error) {
      console.error('Error updating profile:', error);
      setError('Failed to update profile. Please try again.');
    } finally {
      setSaving(false);
    }
  };

  const handlePasswordChange = async () => {
    if (passwordForm.newPassword !== passwordForm.confirmPassword) {
      setError('New passwords do not match');
      return;
    }

    if (passwordForm.newPassword.length < 6) {
      setError('Password must be at least 6 characters long');
      return;
    }

    try {
      setSaving(true);
      await axios.put('/api/users/password', {
        currentPassword: passwordForm.currentPassword,
        newPassword: passwordForm.newPassword
      });
      setSuccess('Password updated successfully');
      setPasswordForm({ currentPassword: '', newPassword: '', confirmPassword: '' });
      setPasswordDialog(false);
    } catch (error) {
      setError(error.response?.data?.message || 'Failed to update password');
    } finally {
      setSaving(false);
    }
  };

  const handleAvatarUpdate = async (newAvatarUrl) => {
    try {
      setProfile(prev => ({ ...prev, avatar_url: newAvatarUrl }));

      const response = await axios.put('/api/users/profile', {
        avatar_url: newAvatarUrl
      });

      if (response.data.user) {
        updateUser(response.data.user);
        setSuccess('Profile picture updated successfully!');
      }

    } catch (error) {
      console.error('Error updating avatar:', error);
      setError('Failed to update profile picture. Please try again.');
    }
  };

  // Loading state
  if (loading) {
    return (
      <Container sx={{ py: 4, textAlign: 'center' }}>
        <CircularProgress />
        <Typography sx={{ mt: 2, color: '#ccc' }}>Loading profile...</Typography>
      </Container>
    );
  }

  return (
    <Container maxWidth="xl" sx={{ py: 4, mb: 10 }}>
      {/* Profile Header */}
      <Paper 
        elevation={0}
        sx={{ 
          background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
          borderRadius: '24px',
          p: 4,
          mb: 4,
          color: 'white'
        }}
      >
        <Grid container spacing={3} alignItems="center">
          <Grid item>
            <Badge
              overlap="circular"
              anchorOrigin={{ vertical: 'bottom', horizontal: 'right' }}
              badgeContent={
                <IconButton
                  size="small"
                  onClick={() => setAvatarUploadDialog(true)}
                  sx={{
                    bgcolor: 'rgba(255,255,255,0.2)',
                    color: 'white',
                    '&:hover': { bgcolor: 'rgba(255,255,255,0.3)' }
                  }}
                >
                  <PhotoCamera fontSize="small" />
                </IconButton>
              }
            >
              <Avatar
                src={profile.avatar_url?.startsWith('gradient:') ? undefined : profile.avatar_url}
                sx={{ 
                  width: 120, 
                  height: 120,
                  border: '4px solid rgba(255,255,255,0.3)',
                  fontSize: '3rem',
                  background: profile.avatar_url?.startsWith('gradient:') 
                    ? profile.avatar_url.replace('gradient:', '') 
                    : undefined
                }}
              >
                {profile.display_name?.charAt(0)?.toUpperCase() || profile.username?.charAt(0)?.toUpperCase()}
              </Avatar>
            </Badge>
          </Grid>

          <Grid item xs>
            <Box sx={{ display: 'flex', alignItems: 'center', gap: 2, mb: 1 }}>
              <Typography variant="h4" sx={{ fontWeight: 'bold' }}>
                {profile.display_name || profile.username}
              </Typography>
              <Chip 
                label="Artist" 
                size="small"
                sx={{ 
                  bgcolor: 'rgba(255,255,255,0.2)',
                  color: 'white'
                }}
              />
            </Box>

            <Typography variant="h6" sx={{ opacity: 0.8, mb: 2 }}>
              @{profile.username}
            </Typography>

            {profile.bio && (
              <Typography variant="body1" sx={{ mb: 2, maxWidth: 600 }}>
                {profile.bio}
              </Typography>
